import React from "react";
import Tuscany from '../../DB/Tuscany.json';
import date from '../assets/home/icons/Tours/clndr_orng.svg';
import group from '../assets/home/icons/Tours/group_col.svg';
import time from '../assets/home/icons/Tours/time.svg';

export default function Search () {

    return(
        <>
        <h3>Search Results</h3>
        <section>
            <img/> 
           <h2>{Tuscany.title}</h2>

            <section>
                <img src={date} alt="Tour's date"/> <h3>Date:</h3> <p></p> 
            </section>
            <section>
                <img src={time} alt="Tour's time"/> <h3>Time</h3> <p></p>
            </section>
            <section>
                <img src={group} alt="Number of  tour's people"/> <h3>Number of people</h3> <p></p>
            </section>
        </section>
        </>
    )
}
